full_text:
@Philip_Goff One more Q

An imperative question in consciousnesses for me is our ‘selves’

Cosmopsychism can explain a variety of consciousness, but in terms of the theory of ‘self’ can it give any further insight to me-ness than the physicalist and dualist theories?

@Philip_Goff I think there is still an explanatory gap between everything being conscious and the concept of self. 

Either the self becomes a distinct entity and a different form of consciousness, or the self is a function of already conscious evolution.

How would you explain self?

@Jewzak When you say science, do you mean natural philosophy?

Your reasoning has an epistemological basis, that we should view life with a goal towards scientific verification.

This is a philosophical claim.

Two things I seek;

Mental toughness, and the ability to continually forgive.

Being resilient, and able to move forward are two imperative elements for developing yourself.

